import { useState, useContext } from "react";
import TokenContext from './TokenContext';

const Home=()=>{
    const { logout } = useContext(TokenContext);

    const handleLogout = ()=>{
        logout()
    }
    return(
        <div>
            <label>Food name</label>
            <button onClick={handleLogout}>Logout</button>
        </div>
    )
}

export default Home;
